package com.jty.model;import java.io.Serializable;import java.util.Date;import javax.persistence.Entity;import javax.persistence.Id;@SuppressWarnings("serial")@Entity(name = "userorder")public class UserOrder implements Serializable {    @Id	private Integer id;    private String orderCode;    private Long userId;    private Float totalMoney;    private Date createTime;    private String startTime;    private String endTime;    private Integer carId;    private String tjOrderCode;	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public String getOrderCode() {		return orderCode;	}	public void setOrderCode(String orderCode) {		this.orderCode = orderCode;	}	public Long getUserId() {		return userId;	}	public void setUserId(Long userId) {		this.userId = userId;	}	public Float getTotalMoney() {		return totalMoney;	}	public void setTotalMoney(Float totalMoney) {		this.totalMoney = totalMoney;	}	public Date getCreateTime() {		return createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}		public String getStartTime() {		return startTime;	}	public void setStartTime(String startTime) {		this.startTime = startTime;	}	public String getEndTime() {		return endTime;	}	public void setEndTime(String endTime) {		this.endTime = endTime;	}	public Integer getCarId() {		return carId;	}	public void setCarId(Integer carId) {		this.carId = carId;	}	public String getTjOrderCode() {		return tjOrderCode;	}	public void setTjOrderCode(String tjOrderCode) {		this.tjOrderCode = tjOrderCode;	}}